script: |
  super -f text -I q9860.spq | sort > q9860.out

inputs:
  - name: q9860.spq
    data: |
      SELECT DISTINCT * FROM tab0 (FORMAT parquet) WHERE NOT - + col2 / 92 - - col2 + - col1 + - col1 + - col0 BETWEEN ( + 87 ) AND - 92 / - 75;
  - name: tab0

outputs:
  - name: q9860.out
    data: |
      15	81	47
      87	21	10
      97	1	99
